INSERT INTO `community` (`created_at`, `id`, `modified_at`, `title`, `content`, `email`) VALUES ('2025-02-17 15:06:35', 26, '2025-02-17 15:06:35', '구찌말고 수제 파우치도 예쁘답니다', '이건 다른 분들이 실제로 구매하고 후기로 찍어주신 사진이에용', 'seller3@test.com');
INSERT INTO `community` (`created_at`, `id`, `modified_at`, `title`, `content`, `email`) VALUES ('2025-02-17 15:08:54', 27, '2025-02-17 15:08:54', '스티커!', '선물 포장과 메세지를 한 번에!\r\n\r\n이런 꿀 템 한번 써보세용', 'seller3@test.com');
