INSERT INTO `community` (`created_at`, `id`, `modified_at`, `title`, `content`, `email`) VALUES ('2025-02-17 15:18:53', 30, '2025-02-17 15:18:53', '졸업 선물~', '졸업식에 가져갈 색다른 꽃~\r\n\r\n영구적인 짱구 꽃!!\r\n이번에 딸 졸업할 때 줬는데 많이 좋아했어요 ㅎㅎ\r\n배송 때도 이렇게 보내주셔서 온전하게 받을 수 있었어용\r\n', 'seller3@test.com');
